  input: '"TEXT","F3XA","C00034033","The outstanding balance for a debt owed to SCGOP
    Non-Federal was corrected with our March 20, 2003 amendment of the July Quarterly
    Report 2002.  Our original solicitation includes a clear and conspicuous request
    for the contributors name, address, occupation, and name of employer.  We inform
    the contributor of the requirements of the federal law for the reporting of such
    information.  If the information is not provided, we first use the internet to
    obtain this information.  If we are still unsuccessful, we contact the contributor
